import{QualificationModel}from"../model/qualification-model.js";import{Utility}from"../shared/utility.js";import ScriptSeriesLoader from"../shared/script-series-loader.js";class QualificationController{constructor(){this.model=new QualificationModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load()}static build=async()=>{const i=new QualificationController;for(;i.scriptLoader.running;)await Utility.sleep(2e3);return i};execute=()=>{const i=this.model.getQualifications();for(const o of i)$("div#qualification").append(`<p>${o.name} ${o.score}</p>`)}}export{QualificationController};